sap.ui.define(
  [
    "com/ContactsApp/Application/Base/BaseController",
    "sap/m/MessageToast",
    "com/ContactsApp/Service/Contact.service",
  ],
  function (BaseController, MessageToast, ContactService) {
    "use strict";

    return BaseController.extend(
      "com.ContactsApp.Application.Register.controller.Register",
      {
        onInit: function () {
          oModel.setProperty("/newUser", this.getEmptyUserObject());
        },

        fileUploadChange: function (oControlEvent) {
          const files = oControlEvent.getParameters().files;
          const file = files[0];
          this.fileToBase64Converter(file)
            .then((base64) => {
              oModel.setProperty("/newUser/image", base64);
            })
            .catch((error) => {
              MessageToast.show(error);
            });
          this.byId("fileUploader").clear();
        },

        fileToBase64Converter: function (file) {
          return new Promise((resolve, reject) => {
            const reader = new FileReader();
            reader.readAsDataURL(file);
            reader.addEventListener(
              "load",
              () => {
                const fileBase64 = reader.result;
                resolve(fileBase64);
              },
              false
            );
            reader.addEventListener("error", (error) => {
              reject(error);
            });
          });
        },

        onPressAddBtn: function () {
          const newUser = oModel.getProperty("/newUser");
          if (
            newUser == this.getEmptyUserObject() ||
            newUser.password.length < 3
          ) {
            MessageToast.show("Missing or incorrect entry");
            return;
          }
          ContactService.addContact(newUser)
            .then((contact) => {
              oModel.setProperty("/newUser", this.getEmptyUserObject());
              MessageToast.show("Added contact with id:" + contact.id);
            })
            .catch((error) => {
              MessageToast.show(error);
            });
        },

        onPressCancelBtn: function () {
          oModel.setProperty("/newUser", this.getEmptyUserObject());
          MessageToast.show("Inputs cleared");
        },

        onPressNavToLoginPage: function () {
          this.navTo("Login");
        },

        getEmptyUserObject() {
          return {
            id: null,
            name: "",
            lastName: "",
            eMail: "",
            password: "",
            image:
              "data:image/png;base64,",
          };
        },
      }
    );
  }
);
